import Slider from 'react-slick';
import Slide from './Slide/Slide';
import slider1Desktop from '../../assets/slider-imgs/desktop/spring-collection-2019-desktop.jpg'
import slider2Desktop from '../../assets/slider-imgs/desktop/short-sleeves-2019-desktop.jpg'
import './Slider.css';

export default class SimpleSlider extends React.Component {



    render() {
      const settings = {
        dots: true,
        infinite: true,
        speed: 500,
        autoplay: true,
        slidesToShow: 1,
        slidesToScroll: 1
      };
      return (
        <Slider {...settings}>
          <div>
          <Slide />
          </div>
          <div>
          <Slide />
          </div>
        </Slider>
      );
    }
  }
